import React,{Component} from 'react';
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';

class Sstate extends Component{
    constructor(){
        super()
        const StateObj = {
            name: 'Ismail',
            age: '31',
            roll: '3',
            nomber: '01874631310'
        }
        this.state = StateObj
    }
    render(){
        return <div>
            <h3>My name is : {this.state.name}</h3>
            <h3>My age is : {this.state.age}</h3>
            <h3>My roll is : {this.state.roll}</h3>
            <h3>My mobile number is : {this.state.nomber}</h3>
        </div>
    }
}
export default Sstate;
